Here is a sample code for a chrome extension that takes screenshots of a website and saves them to a folder on your computer:
```
// manifest.json
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "A chrome extension that takes screenshots of a website and saves them to a folder on your computer.",
  "manifest_version": 2,
  "permissions": [
    "activeTab",
    "storage",
    "tabs"
  ],
  "background": {
    "scripts": ["background.js"]
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}

// background.js
chrome.tabs.onUpdated.addListener(function(tabId, changeInfo, tab) {
  if (changeInfo.status === "complete") {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = "screenshot-" + Date.now() + ".png";
      chrome.downloads.download({
        url: dataUrl,
        filename: filename,
        saveAs: true
      });
    });
  }
});

// popup.html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension</title>
    <script src="popup.js"></script>
  </head>
  <body>
    <button id="take-screenshot">Take Screenshot</button>
  </body>
</html>

// popup.js
document.getElementById("take-screenshot").addEventListener("click", function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = "screenshot-" + Date.now() + ".png";
      chrome.downloads.download({
        url: dataUrl,
        filename: filename,
        saveAs: true
      });
    });
  });
});
```
