## Inline Styles

Inline styles are the most basic way to style a react component. You can use the style prop to pass a JavaScript object with CSS properties to a component. For example:
```
const divStyle = {
  color: 'white',
  backgroundImage: 'url(' + imgUrl + ')',
  WebkitTransition: 'all', // note the capital 'W' here
  msTransition: 'all' // 'ms' is the only lowercase vendor prefix
};

function HelloWorldComponent() {
  return (
    <div style={divStyle}>
      Hello World!
    </div>
  );
}
```
